#Tambin es para hacer la tokenizacin, pero tambin se quita los caracteres sealados, en pocas palabras este bloque de cdigo hace lo mismo que los dems, pero en un solo bloque
def tokenizar(texto):
  #buscamos simbolos para sacarlos de la cadena de texto
    puntuacion = '!"#$%&\'()*+,-./:;<=>?@[\\]^_`{|}~..'
    #usamos un especializador para tokenizar enfocado al idioman espaol
    tokens = nltk.word_tokenize(texto,"spanish")
    #recorremos los tokens
    for i,token in enumerate(tokens):
        tokens[i] = token.strip(puntuacion)
        #sustituimos los caracteres por espacios vacios
    texto = " ".join(tokens)
    tokens = nltk.word_tokenize(texto,"spanish")
    return tokens

#Es el metodo de Normalizacin
def stemmizar(tokens):
  #Su objetivo es reducir la forma de las palabras
    stemmer = nltk.stem.SnowballStemmer("spanish")
    stems = []
    for token in tokens:
        stem = stemmer.stem(token)
        stems.append(stem)
    return stems

